create procedure mkAddress
	@Code nvarchar(50),
	@Name nvarchar(100),
	@AddressLine nvarchar(200),
	@City nvarchar(200),
	@Zip nvarchar(200),
	@CountryCode nvarchar(3),
	@IcCompanyCode nvarchar(50),
	@CompanyCode nvarchar(50)
as
	declare @InternalCompanyId int
	declare @CountryId int
	declare @AddressId int
begin

set nocount on

select top 1 @InternalCompanyId = COMPANY_ID from COMPANY where CODE = @IcCompanyCode order by COMPANY_ID
select @CountryId = COUNTRY_ID from COUNTRY where CODE = @CountryCode;
declare @CompanyId int = ( select COMPANY_ID from COMPANY where CODE = @CompanyCode );
declare @user varchar(10) = 'la180511' ;

INSERT INTO [dbo].[ADDRESS]
           ([CODE]
           ,[NAME]
		   ,[ADDRESS_LINE]
           --,[ADDRESS_LINE_2]
		   ,[COUNTRY_ID]
           ,[CREATE_USER]
           ,[CREATE_TIMESTAMP]
           ,[UPDATE_USER]
           ,[UPDATE_TIMESTAMP]
           ,[REMARKS]
           ,[CITY]
           ,[ZIP])
     VALUES
           (
		   @Code
		   ,@Name
           ,@AddressLine
		   --,@AddressLine2
           ,@CountryId
           ,@user
           ,getdate()
           ,@user
           ,getdate()
           ,null -- REMARKS
           ,@City
           ,@Zip)
select @AddressId = SCOPE_IDENTITY();
print N'CRM_ADDRESS.ADDRESS_ID=' + cast(@AddressId as nvarchar)

insert into COMPANY_ADDRESS (COMPANY_ID, ADDRESS_ID)
	values (@CompanyId, @AddressId);

set nocount off

end
go

